import './styles/App.css';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import TeacherRegistration from './pages/TeacherRegistration';
import SignIn from './pages/SignIn'; // New SignIn page
import AdminDashboard from './pages/AdminDashboard';
import ProtectedRoute from './components/ProtectedRoute'; // A component to protect admin routes

function App() {
  return (
    <Router>
      <Routes>
        <Route path="/" element={<SignIn />} /> {/* Changed to SignIn */}
        <Route path="/register" element={<TeacherRegistration />} />
        <Route path="/admin-dashboard" element={<ProtectedRoute component={AdminDashboard} />} />
      </Routes>
    </Router>
  );
}

export default App;
